import { StyleSheet } from "react-native";

const styles = StyleSheet.create({

    CardFunction:{
        padding: 24,
    },

    CardFunctionRow:{
        flexDirection: 'row',
        alignItems: 'center',
        justifyContent: 'space-between',
    },

    Subtitle:{
        fontSize: 16,
        fontWeight: 600,
    },

    TextGrey:{
        color: '#c2bebe',
        fontWeight: 600,
        marginTop: 10,
    },

    Title:{
        fontSize: 20,
        fontWeight: 600,
        marginTop: 10,
    },

})

export default styles
